using System.Collections.Generic;using UnityEditor;using System;public class Config_t_TakeCardLevel : AssetData{	public List<t_TakeCardLevel> asset = new List<t_TakeCardLevel>();	public void addContent(t_TakeCardLevel item)	{		asset.Add(item);	}	public static bool isloaded;	public static Dictionary<int, t_TakeCardLevel> _data { get; private set; }	public void init()	{		_data = new Dictionary<int, t_TakeCardLevel>();		for (int i = 0; i < asset.Count; i++){			_data.Add(asset[i].id, asset[i]);		}		asset = null;		isloaded = true;	}	public static t_TakeCardLevel getOne(int id)	{		if (_data.ContainsKey(id))			return _data[id];		else			throw new Exception("not find" + id);	}	public static void Dispose()	{		_data = null;	}}[Serializable]public class t_TakeCardLevel{	public int id;	public string sname;	public int normal;	public int fire;	public int water;	public int thunder;	public int forest;	public int arcane;	public int goden;}